import React from 'react';

const Card= (props) =>{
  const {name, id, email}=props;
  return(
    <div className=" tc bg-light-blue dib br3 pa3 ma2 grow pw2 shadow-5">
      <img alt='robot' src={`https://robohash.org/kfso${id}?10000`}/>
      <div>
        <h2>
          {name}
        </h2>
        <p>{email}</p>
      </div>
    </div>
  );
}
export default Card;
